`,n.jsx(e.p,{children:"2차로 마이크로 프론트엔드를 적용하였는데, cdn으로 각 서비스를 배포하고, 그 cdn 주소로부터 component를 import하여 등록하는 방식을 적용하였습니다. 그렇기 때문에, 각 서비스별로 개별 배포가 가능해졌으며, AB 테스트를 추가로 도입하여 각 부분별 문제가 발생했을 때, 롤백이 가능하도록 구성하였습니다."}),`
